import React from 'react';
import { NavLink } from 'react-router-dom';
import { AuthNavCss, NavLinkStyle } from './AuthNav.styled';

export const AuthNav = () => {
  return (
    <AuthNavCss>
      <li>
        <NavLink className={NavLinkStyle} href="/register">Реєстрація</NavLink>
      </li>
      <li>
        <NavLink className={NavLinkStyle} href="/login"> Увійти </NavLink>
      </li>
    </AuthNavCss>
  );
};
